{{Infobox dungeon |name = Seafloor Cavern |image = [[File:Seafloor Cavern.png|250px]] |caption = A map of Seafloor Cavern. |tokens = 32,000 |location = To the west of Route 128. }} '''Seafloor Cavern''' is a [[Dungeons|dungeon]] in [[Hoenn]]. It initially has 49 tiles arranged in a 7x7 square, including 7 chest tiles, 17 non-boss encounter tiles, and 1 boss encounter tile.
